window.bookSummaryJSON = "<p><b>Baba Yaga has taken over and no one knows if Bethany Anne will ever come back. </b></p> <p>Beaten on the crucible, Bethany Anne decided she will bring justice to the Kurtherians that tortured the Leath and her people, <i>personally</i>. </p> <p><b>The problem? She releases Baba Yaga who has now taken control. </b></p> <p>Even Adam and Tom aren't sure they can help their friend.</p> <p><i>While Baba Yaga is tracking down the Seven Kurtherians, her friends and family are desperately trying to find her. During this time, General Lance Reyolds must start negotiations with other star nations who wish to create an Etheric Federation.</i></p> <p>The problem?</p> <p><b><i>How can you complete an Etheric Federation Treaty, if you can't find the Empress?</i></b></p>"; 
